import React from "react";
//import Pion from './Pions';
import './style.css';

const Case = () => {

    const Pion = () => {

        const changeColor = (e) => {
            console.log(e.target)
            e.target.classList.remove('styled')
        }

        return (
            <div onClick={changeColor} style={{ display: 'flex', justifyContent: 'space-around', alignItems: 'center' }}>
                <div className="pion styled"></div>
            </div>
        )
    }

    return (
        <div className="rondCases" onClick={Pion}>
            <Pion />
        </div>
    )
}

export default Case;
